// import React from 'react';
import Card1img from '../../src/images/cards/card1img.svg';
import Card2img from '../../src/images/cards/card2img.svg';

const CardsMean = [
    {
        title: "Отдых",
        img: {Card1img},
    },
    {
        title: "Бизнес",
        img: {Card2img},
    },
    {
        title: "Банкеты",
        img: {Card1img},
    },
    {
        title: "Здоровье",
        img: {Card2img},
    }
]

export {CardsMean};
